import React from 'react'

const Form = props => {
    return (
        <form onSubmit={props.getMeals}>
            <label htmlFor="duration">Duration </label> <br/>
            <input type="radio" id="day" name="duration" value="day"/>
            <label htmlFor="day">Day </label><br/>
            <input type="radio" id="week" name="duration" value="week"/>
            <label htmlFor="week">Week </label><br/>
            <label htmlFor="calories">Target Daily Calories </label><br/>
            <input type="number" min="1" id="calories"/><br/>
            <label htmlFor="diet">Diet </label><br/>
            <input type="text" id="diet" placeholder="Vegetarian, Keto..."/><br/>

            <button type="submit">Get Meal Plan</button>
        </form>
    )
};

export default Form

